import React from 'react';

const RemoveAssetButton = () => {
  return (
    <div className="w-[135px] h-[41px] p-4 bg-[#093b82] rounded-lg inline-flex justify-center items-center gap-4">
      <div className="flex-col justify-start items-start inline-flex">
        <div className="text-white text-xl font-semibold font-['Roboto']">
          Remove Asset
        </div>
      </div>
    </div>
  );
};

export default RemoveAssetButton;
